import "./App.css";
import React from "react";
import Header from "./Header"
import Content from "./Content";


function Footer() {
  return <footer>Mohamed Amir</footer>;
}

function App() {
  return (
    <div>
      <Header />
      <Content />
      <Footer />
    </div>
  );
}


export default App;
